From the display at ANHM:<br />
&quot;The female King Cobra, Ophiophagus hannah, of Southeast Asia constructs a nest a few days before egg deposition, perhaps a month after mating.  Forming an open loop with her head and forebody, she scoops plant debris and soil into a pile within a stand of bamboo.  She forms a pile about 15cm (6in.) high and compacts the interior into a bowllike depression by crawling around and pressing on it numerous times, occasionally pausing to gather more litter.  After depositing about 20 to 50 eggs, she covers them with additional debris.  Males are not tolerated near the nest.&quot;

